import React from 'react';
import {ReactComponent as Logo} from "Icon"

function App() {
  return (
    <div>
      <nav>
        <ul>
          {Logo}
          <li> Home </li>
          <li> 2nd page </li>
          <li> 3rd page </li>
          <li> 4th page </li>
          <li> 4th page </li>
        </ul>
      </nav>
    </div>
  );
}

export default App;
